const List = ({ listName, listItems }) => {
    return ( 
        <div>
            <h2>{listName}</h2>
            <ul>
                {listItems && listItems.map(item => <li>{item.stat.name}: item.</li>)}
            </ul>
        </div>
     );
}

export default List;
